const fillWithFields= async (jsonData, fields, page, pdfDoc)=>{
  if (fields && fields.length > 0) {
      fields.forEach(async (element, indexElement)=>{
        if (element && jsonData) {
          const { type, x , y , x2, y2, size, size2, key } = element;
          if (type == "drawRect") {
            const { w, h } = element;
            addShapeRect({x,y, w : w || 20 , h: h || 40}, page);
          }
          if (jsonData[key]) {            
            if (type == "text") {
              page.drawText(jsonData[key], { x, y : page.getHeight() - y, size: size || 5 })
              if (x2 && y2) {
                page.drawText(element.text, { x : x2, y : page.getHeight() - y2, size: size2 || 5 })
              }
            }else if (type == "table") {
              // for table
              /*const arrayDeObjetos = [
                { nombre: 'Juan', edad: 30, ciudad: 'Buenos Aires' },
                { nombre: 'María', edad: 25, ciudad: 'Madrid' },
                { nombre: 'Carlos', edad: 40, ciudad: 'México DF' },
              ];*/
              const { header, modeTable, cellWidth, cellHeight } = element;
              const arrayDeArrays = transformarArrayDeObjetos(jsonData[key]);
              arrayDeArrays[0] = header;
              addTable(arrayDeArrays,page, x, y, modeTable, cellWidth, cellHeight  )
            }else if(type=="imgB64"){
              const { typeImg, w, h } = element;
              // for img B64
              const imagenBase64 = jsonData[key] || "data:image/jpeg;base64,"
              // console.log("JSON IMAGE b64", jsonData[key], element)
              
              await addImgB64(page, pdfDoc, imagenBase64, typeImg || "jpeg", x, y, w, h);
            }else if(type=="img"){
              const { typeImg, w, h} = element;
              // console.log("JSON IMAGE ", jsonData[key], element)
              await addImg(page, pdfDoc, jsonData[key], typeImg, x, y, w, h);
            }
          }else{
            console.log("!! No exist key data for creation ", key)
          }
        }
      }); // forEach
    }else{
      console.error("!! Required fields for generate pdf ");
    }
    return true
}

// Función para transformar un array de objetos a un array de arrays
const transformarArrayDeObjetos = (arrayDeObjetos) =>{
  if (!Array.isArray(arrayDeObjetos) || arrayDeObjetos.length === 0) {
    return []; // Devolver un array vacío si el input no es un array o está vacío
  }

  // Obtener las propiedades del primer objeto para usar como encabezado
  const encabezado = Object.keys(arrayDeObjetos[0]);

  // Transformar cada objeto en un array de valores
  const arrayDeArrays = arrayDeObjetos.map(objeto =>
    Object.values(objeto).map(item=> item.toString())
  );
  // const arrayDeArrays = arrayDeArrays1.map(item=> item.toString()) 


  // Agregar el encabezado al principio del array de arrays
  arrayDeArrays.unshift(encabezado);

  return arrayDeArrays;
}



const addShapeRect = ({x,y,w,h,fillColor=rgb(1, 0, 0), color, borderWidth }, page )=>{
 page.drawRectangle({
    x: x+2,
    y: page.getHeight() - y - h, // Invertir la coordenada Y para que sea desde abajo hacia arriba
    width: page.getWidth()-5,
    height: h,
    borderColor: rgb(0, 0, 0), // Color del borde (rojo)
    borderWidth: 1, // Ancho del borde
    // color: rgb(0, 1, 0), // Color de fondo (verde)
    fillOpacity: 0, // Opacidad del color de fondo (1 es completamente opaco)
  });
 
}
